let activeComments = [];
let isPaused = false;
let gradientColor1;
let gradientColor2;

function setup() {
    createCanvas(windowWidth, windowHeight);
    frameRate(30);

    gradientColor1 = color(
        map(sin(frameCount * 0.005), -1, 1, 180, 230), // スピードを半分にし、色を明るくしました
        map(sin(frameCount * 0.01), -1, 1, 180, 230),
        map(sin(frameCount * 0.015), -1, 1, 180, 230)
    );

    gradientColor2 = color(
        map(sin(frameCount * 0.01 + PI / 2), -1, 1, 200, 255), // スピードを半分にし、色を明るくしました
        map(sin(frameCount * 0.005 + PI / 4), -1, 1, 200, 255),
        map(sin(frameCount * 0.015 + PI / 3), -1, 1, 200, 255)
    );
}

function draw() {
    background(230);
    for (let i = 0; i <= height; i+=2) {
        let inter = map(i, 0, height, 0, 1);
        let gradientColor = lerpColor(gradientColor1, gradientColor2, inter);
        stroke(gradientColor);
        line(0, i, width, i);
    }

    if (!isPaused) {
        if (random() < 0.1) {
            let randomComment = random(comments).Message;
            activeComments.push(new Comment(randomComment));
        }
    }

    for (let i = activeComments.length - 1; i >= 0; i--) {
        if (!isPaused) {
            activeComments[i].update();
        }
        activeComments[i].display();
        if (activeComments[i].isOffScreen()) {
            activeComments.splice(i, 1);
        }
    }
}

function windowResized() {
    resizeCanvas(windowWidth, windowHeight);
}

function mouseClicked() {
    isPaused = !isPaused;
}

class Comment {
    constructor(text) {
        this.text = text;
        this.x = width;
        this.y = random(height - 50) + 50;
        this.speed = random(2, 5);
        this.size = random(20, 50);

        let colorIntensity = map(this.size, 20, 50, 120, 50);
        this.color = color(random(colorIntensity, 150), random(colorIntensity, 150), random(colorIntensity, 150));

        this.fonts = ["Roboto", "Lato", "Oswald", "Merriweather", "Raleway", "Pacifico", "Lobster", "Bangers", "Indie Flower", "Amatic SC"];
        this.font = random(this.fonts);  // ランダムにフォントを選択
    }

    update() {
        this.x -= this.speed;
    }

    display() {
        fill(this.color);
        textFont(this.font);  // ここでフォントを適用
        textSize(this.size);
        text(this.text, this.x, this.y);
    }

    isOffScreen() {
        return this.x + textWidth(this.text) < 0;
    }
}
